 -- Question 1: Show all transactions for a given week in your business. 
Use datamart;
DROP TABLE IF EXISTS datamart.transact;
CREATE TABLE datamart.transact  (
  Transact_ID INT NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (Transact_ID), KEY(Payment_ID)
) ENGINE=InnoDB
SELECT Payment_ID, amount,  DATE_FORMAT(Date_stamp, '%D/%m/%Y')FROM 
dublinbikes.payments WHERE Date_stamp BETWEEN '2017-01-01' 
AND '2017-01-07' ORDER BY day(Date_stamp);
SELECT * FROM datamart.Transact;


 -- Question 3: Create a View of stock  (purchased from a supplier)/services used within a 7 day period
Use datamart;
DROP VIEW IF EXISTS datamart.Stock_view;
CREATE VIEW Stock_view AS 
SELECT  S_Status_ID, Station_ID, S_Status, Capacity, Parking, Bikes, 
DATE_FORMAT(Updated, '%D/%m/%Y') From dublinbikes.station_status  WHERE Updated >= '2017-01-01' 
AND Updated <= '2017-04-07' AND (STATION_ID=11) Order BY week(Updated); 
SELECT * FROM datamart.Stock_view;

 -- Question 4:Total stock/services sold to general public (stock by supplier), service by date.
Use datamart;
DROP VIEW IF EXISTS datamart.Total_Weekly_Payments;
CREATE VIEW Total_Weekly_Payments AS 
SELECT  count(Payment_ID), DATE_FORMAT(Date_stamp, '%D/%M/%Y') AS Stock_Weekly 
From dublinbikes.payments WHERE Date_Stamp BETWEEN '2015-01-01' AND '2017-04-01' 
GROUP BY Yearweek (Date_stamp); 
SELECT * FROM datamart.Total_Weekly_Payments;

 -- Question 5:Detail and total all transactions for the month-to-date
Use datamart;
DROP VIEW IF EXISTS datamart.Details_and_Total;
CREATE VIEW Details_and_Total AS 
select sum(amount), DATE_FORMAT(Date_stamp, '%D/%M/%Y') from 
dublinbikes.payments WHERE Date_stamp >= '2017-4-01' AND 
Date_stamp <= '2017-04-31' GROUP BY WEEK (Date_stamp) WITH ROLLUP; 
SELECT  * FROM datamart.Details_and_Total;

 -- Question 6: Detail and total all revenue for the year-to-date.
Use datamart;
DROP VIEW IF EXISTS datamart.Revenue_2017;
CREATE VIEW Revenue_2017 AS 
SELECT
	(c1.amount - c2.price) as Revenue_2015,
  (y1.amount - y2.price) as Revenue_2016,
  (m1.amount - m2.price) as Revenue_2017
  From
	(select sum(amount)as amount from  dublinbikes.payments WHERE Date_stamp >= '2017-01-01' 
    AND Date_stamp <= '2017-04-31'  GROUP BY year (Date_stamp)) as m1,
	(select sum(price) as price from  dublinbikes.repairs WHERE Delivered >= '2017-01-01' 
    AND Delivered <= '2017-04-31'  GROUP BY year (Delivered)) as m2,
    (select sum(amount)as amount from  dublinbikes.payments WHERE Date_stamp >= '2016-01-01' 
    AND Date_stamp <= '2016-12-31'  GROUP BY year (Date_stamp)) as y1,
	(select sum(price) as price from  dublinbikes.repairs WHERE Delivered >= '2016-01-01' 
    AND Delivered <= '2016-12-31'  GROUP BY year (Delivered)) as y2,
    (select sum(amount)as amount from  dublinbikes.payments WHERE Date_stamp >= '2015-01-01' 
    AND Date_stamp <= '2015-12-31'  GROUP BY year (Date_stamp)) as c1,
	(select sum(price) as price from  dublinbikes.repairs WHERE Delivered >= '2015-01-01' 
    AND Delivered <= '2015-12-31'  GROUP BY year (Delivered)) as c2;
SELECT  * FROM datamart.Revenue_2017;

 -- Question 7: Detail & total transactions broken down on a monthly basis for 1 year

Use datamart;
DROP VIEW IF EXISTS datamart.Monthly_Totals_2015;
CREATE VIEW Monthly_Totals_2015 AS 
select sum(amount),DATE_FORMAT(Date_stamp, '%M')  from  dublinbikes.payments 
WHERE Date_Stamp >= '2015-01-30' AND Date_Stamp < '2016-01-01' GROUP BY month(Date_stamp);
SELECT  * FROM datamart.Monthly_Totals_2015;

 -- Question 8: Display the growth in sales/services (as a percentage) for your business, from the 1st month of opening until now.
 -- (Present - Past) / Past * 100

Use datamart;
DROP VIEW IF EXISTS datamart.Growth_Sales_2015;
CREATE VIEW Growth_Sales_2015 AS 
SELECT ((m1.amount - m0.amount)/m0.amount * 100) AS 'January',
((m2.amount - m1.amount)/m1.amount * 100) AS 'February',
   ((m3.amount - m2.amount)/m2.amount * 100) AS 'March',
   ((m4.amount - m3.amount)/m3.amount * 100) AS 'April',
   ((m5.amount - m4.amount)/m4.amount * 100) AS 'May',
   ((m6.amount - m5.amount)/m5.amount * 100) AS 'June',
   ((m7.amount - m6.amount)/m6.amount * 100) AS 'July',
   ((m8.amount - m7.amount)/m7.amount * 100) AS 'August',
   ((m9.amount - m8.amount)/m8.amount * 100) AS 'September',
   ((m10.amount - m9.amount)/m9.amount * 100) AS 'October',
   ((m11.amount - m10.amount)/m10.amount * 100) AS 'November',
   ((m12.amount - m11.amount)/m11.amount * 100) AS 'December'
FROM 
	(SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2001-01-01' AND Date_stamp <= '2014-12-31' ) AS m0,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-01-01' AND Date_stamp <= '2015-01-31' ) AS m1,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE
    Date_stamp >= '2015-02-01' AND Date_stamp <= '2015-02-28') AS m2,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-03-01' AND Date_stamp <= '2015-03-31') AS m3,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-04-01' AND Date_stamp <= '2015-04-30') AS m4,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-05-01' AND Date_stamp <= '2015-05-31') AS m5,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-06-01' AND Date_stamp <= '2015-06-30') AS m6,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-07-01' AND Date_stamp <= '2015-07-31') AS m7,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-08-01' AND Date_stamp <= '2015-08-31') AS m8,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-09-01' AND Date_stamp <= '2015-09-30') AS m9,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-10-01' AND Date_stamp <= '2015-10-31') AS m10,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-11-01' AND Date_stamp <= '2015-11-30') AS m11,
    (SELECT sum(amount) AS amount FROM dublinbikes.payments WHERE 
    Date_stamp >= '2015-12-01' AND Date_stamp <= '2015-12-31') AS m12;
SELECT * FROM datamart.Growth_Sales_2015;

 -- Question 2: Create a trigger that stores stock levels once a sale takes place.
use dublinbikes;
drop trigger if exists update_station_capacity;
DELIMITER ;;
CREATE TRIGGER update_station_capacity AFTER INSERT ON bike_rentals
FOR EACH ROW
BEGIN
	UPDATE Station_Status SET Station_Status.parking = Station_Status.parking - 1
    where  Station_Status.Station_ID= 10;
END;;
DELIMITER ;;

